import React, { useState, useEffect } from 'react';
import { formatMT515Message, formatMT509Message } from '../../services/ficcService';
import { matchTradeToFICCMessage } from '../../services/matchingService';
import TradeMessage from '../TradeMessage/TradeMessage';
import './TradeTable.css';

const TradeTable = () => {
  const [trades, setTrades] = useState([]);
  const [messages, setMessages] = useState([]);
  const [matchingStatus, setMatchingStatus] = useState({});

  useEffect(() => {
    loadTrades();
  }, []);

  const loadTrades = async () => {
    const { data, error } = await supabase
      .from('trades')
      .select('*')
      .order('trade_date', { ascending: false });

    if (error) {
      console.error('Error loading trades:', error);
    } else {
      setTrades(data);
    }
  };

  const handleNewMessage = async (message) => {
    // Add to messages
    setMessages(prev => [...prev, message]);

    // Try to match to existing trade
    const matchedTrade = await matchTradeToFICCMessage(message);

    if (matchedTrade) {
      setMatchingStatus(prev => ({
        ...prev,
        [matchedTrade.id]: {
          status: 'matched',
          message: message
        }
      }));
    }
  };

  return (
    <div className="trade-table">
      <table>
        <thead>
          <tr>
            <th>Trade Date</th>
            <th>Security</th>
            <th>Amount</th>
            <th>FICC Status</th>
            <th>Match Status</th>
          </tr>
        </thead>
        <tbody>
          {trades.map(trade => (
            <tr key={trade.id}>
              <td>{trade.trade_date}</td>
              <td>{trade.security_id}</td>
              <td>{trade.amount}</td>
              <td>{trade.ficc_status || 'Pending'}</td>
              <td>{matchingStatus[trade.id]?.status || 'Unmatched'}</td>
            </tr>
          ))}
        </tbody>
      </table>

      <div className="messages">
        {messages.map((msg, i) => (
          <TradeMessage key={i} message={msg} />
        ))}
      </div>
    </div>
  );
};

export default TradeTable;
